Game is a trait. You can define your own game struct and implement this trait and also Clone: #[derive(Clone)]
struct MyGame { world: MyWorld, counter: i32,
} impl Game<SharedState, Input> for MyGame { fn world_config(&mut self) { } fn update(&mut self, input: Input, shared_state: Arc<Mutex<SharedState>>) { } fn reset_input(&mut self, input: Arc<Mutex<Input>>) { } fn render(&mut self) {} fn end_game(&self) -> bool { false }
} The struct MyGame has the world. We also defined another property called counter, just to show that you can create and customize your game however you wish. The Game trait has two generic types, the first is K. K is used for sharing information with the client, it is a way to define which data is sent off to the client. For now, we defined the generic K as a struct called SharedState. We will talk about the shared state later. For now, let's define it as an emtpy struct: #[derive(Debug, Serialize, Deserialize, Clone)]
pub struct SharedState {
} impl SharedState { pub fn new() -> Self { Self { } }
} The shared state must implement these traits, hence we need to add Serde to our proyect in order to serialize/deserialize the data sent. At the top of the file add the following: #[macro_use]
