extern crate serde_json; The second generic type is I which was used before, we defined it as the Input tuple struct. If the function signatures are confusing, here is the generic definition: pub trait Game<K, I> { fn world_config(&mut self); fn update(&mut self, input: I, shared_state: Arc<Mutex<K>>); fn reset_input(&mut self, input: Arc<Mutex<I>>); fn render(&mut self); fn end_game(&self) -> bool;
