In the file's main function (or create the function), we will configure our server. We need to define: Port: a port where our server will listen to incoming connections Max games Max players per game The game Shared state (to send to client) Client input type Rate at which data is sent to client (FPS or HZ) Rate at which the game updates (FPS or HZ) How to handle client input The server's new function has the following signature: pub fn new<T: Game<K, I>, K, I, M>( port: i32, max_games: i32, max_players: i32, game: T, shared_state: K, input: I, handle_input: &'static (dyn Fn(Receiver<(M, usize)>, Arc<Mutex<I>>) -> I + Sync), send_data_rate: i32, game_update_rate: i32,
) ... The new type is M, which is a type used for the Messages sent from client to the game. Let's create our basic configuration: fn main() { let port = 8888; let max_games = 4; let max_players = 2; let world = MyWorld::new(); let shared_state = SharedState::new(); let game = new_game(world); // The data that a client message will manipulate let input_type = Input::default(); let hanlde_input = &handle_client_message; // Engine speeds let send_data_from_server_rate = 1; let server_game_update_rate = 2; // 2 times per second // Start server + games Server::new( port, max_games, max_players, game, shared_state, input_type, hanlde_input, send_data_from_server_rate, server_game_update_rate, );
} We have a couple of missing definitions, let's create them. Input: #[derive(Debug, Clone, Copy)]
struct Input(Message, usize); impl Input { fn default() -> Self { Self(Message::None, 0) } fn from(m: Message, id: usize) -> Self { Self(m, id) }
} We are changing the input to contain a Message, and a number of type usize. This second one is for identification, it will be passed by the client to identify the player generating the Input. Message: #[derive(Serialize, Deserialize, Clone, Copy, Debug)]
pub enum Message { None, W, A, S, D, AddPlayer, RemovePlayer,
} SharedState: #[derive(Debug, Serialize, Deserialize, Clone)]
pub struct SharedState { pub counters: Vec<u32>, pub registry: Vec<Position>,
} impl SharedState { pub fn new() -> Self { Self { registry: vec![], counters: vec![], } }
} The shared state will be to show the counters and the positions of players. Handle client message: fn handle_client_message(receiver: Receiver<(Message, usize)>, input: Arc<Mutex<Input>>) -> Input { for (message, id) in receiver { println!("Player {} called {:?}", id, message); *input.lock().unwrap() = Input::from(message, id); } Input::default()
} This is an interesting code bit. To handle a client message, when creating the server, an Application is created which wraps the Game, and is in charge for calling the game loop and also connecting all inputs and communications. Hence this function is to handle inputs. It actually handles messages. A Message will be sent from the client. The Receiver will receive the Message and decide what Input to generate based on the message. For now, we are just passing the message on to the Input which will be used in the update_systems function inside the World. The Input is wrapped in a Arc and Mutex.

