Let's make some systems that will be used. Adding a player entity, with a player component and position: fn add_player_system(world: &mut MyWorld, player_id: usize) { let ent = world.entity_manager.create_entity(); world.players.add(ent, player_id); world.positions.add(ent, Position::new()); world.player_id_map.players.insert(player_id, ent);
} When a player joins a game, they get a UID defined by the server. However, the World has no way to know which entity belongs to a player. Hence we created the PlayerIdMap: #[derive(Debug, Clone)]
struct MyWorld { entity_manager: EntityManager, positions: PositionRegistry, counters: CounterRegistry, players: PlayerRegistry, player_id_map: PlayerIdMap,
} impl World<Input> for MyWorld { fn new() -> Self { Self { entity_manager: EntityManager::new(), positions: PositionRegistry::new(), counters: CounterRegistry::new(), players: PlayerRegistry::new(), player_id_map: PlayerIdMap::new(), } } fn run_systems(&mut self, input: Input) { ... }
} #[derive(Debug, Clone)]
struct PlayerIdMap { players: HashMap<usize, u32>,
}
impl PlayerIdMap { fn new() -> Self { Self { players: HashMap::new(), } }
} Updating player position system: fn update_player_pos_system(world: &mut MyWorld, player_id: usize, displacement: Position) { if let Some(ent) = world.player_id_map.players.get(&player_id) { *world .positions .components .entry(*ent) .or_insert(displacement) += displacement; }
} Removing a player system: fn remove_player_system(world: &mut MyWorld, player_id: usize) { if let Some(ent) = world.player_id_map.players.get(&player_id) { world.players.components.remove(ent); world.positions.components.remove(ent); world.entity_manager.remove_entity(*ent); world.player_id_map.players.remove(&player_id); }
}

