Now we are ready to make our client! In the beggining of the file write the following: extern crate example; use example::Message;
use example::SharedState; use std::io::{self, BufRead, BufReader, Write};
use std::net::{Shutdown, TcpStream};
use std::str;
use std::sync::{Arc, Mutex};
use std::thread; struct Client {} Our Client struct will be used to define related functionality. The way the server works is the following: Server is started listening to a TCP port Server creates threads based on how many games were specified Server opens different TCP listeners (on different ports) per game When a client connects to the server, the following happens: Server looks for an available game (based of player capacity) If it finds a game, it returns the TCP port of said game In none are found, the port returned is 0 Based on this we can create a basic client that tries to connect to the server and receive a port number. impl Client { fn start() { let mut stream = TcpStream::connect("0.0.0.0:8888").expect("Could not connect to server"); let port: i32; let mut input = String::new(); let mut buffer: Vec<u8> = Vec::new(); println!("Enter your username: "); io::stdin() .read_line(&mut input) .expect("Failed to read from stdin"); println!("Finding an available lobby..."); stream .write(input.as_bytes()) .expect("Failed to write to server"); let mut reader = BufReader::new(&stream); reader .read_until(b'\n', &mut buffer) .expect("Could not read into buffer"); port = str::from_utf8(&buffer) .expect("Could not write buffer as string") .replace("\n", "") .parse() .expect("Could not parse port"); if port == 0 { println!("No game available, please try again later"); return; } stream .shutdown(Shutdown::Both) .expect("Could not disconnect from original server"); let tcp = format!("0.0.0.0:{}", port); Client::run_game(tcp); }
} The server needs to receive an input in order to acknowledge that a player wants to connect, hence we are defining a username, but it will actually never be read. If no game is found, a port of 0 will be returned. We can check this to see if the client should continue to try and connect. At the end, Client::run_game(tcp) starts the game connection. Let's see how we can define such game.

