"; let should_close = Arc::new(Mutex::new(false)); let should_close_copy = Arc::clone(&should_close); // Write add player message stream .write(json.as_bytes()) .expect("Failed to write to server"); println!("data written"); // User Input thread thread::spawn(move || { let shoud_close = should_close_copy; loop { let mut input = String::new(); io::stdin() .read_line(&mut input) .expect("Failed to read from stdin"); let input = input.trim(); let mut data = Message::None; // Player controls if input == "w" { data = Message::W; } else if input == "a" { data = Message::A; } else if input == "s" { data = Message::S; } else if input == "d" { data = Message::D; } else if input == "close" { data = Message::RemovePlayer; *shoud_close.lock().unwrap() = true; } let json = serde_json::to_string(&data).unwrap() + "
"; stream .write(json.as_bytes()) .expect("Failed to write to server"); } }); // Stream Reader thread thread::spawn(move || { let stream = stream_clone; loop { let mut buffer: Vec<u8> = Vec::new(); let mut reader = BufReader::new(&stream); reader .read_until(b'
', &mut buffer) .expect("Could not read into buffer"); let json = str::from_utf8(&buffer).unwrap(); let state: SharedState = serde_json::from_str(&json).unwrap(); // Print shared state! println!("{:?}", state); } }); // Keep thread alive, so TCP connection on other threads doesn't reset loop { if *should_close.lock().unwrap() { return; } }
